webpackJsonp([0x2bc2e28c9a6a4c00],{"./node_modules/json-loader/index.js!./.cache/json/linux-basic-linux-commands.json":function(e,n){e.exports={data:{markdownRemark:{html:"<h2>Basic Linux Commands</h2>\n<p>When starting out with linux, there are some basic commands everyone should know.</p>\n<p>  1. <strong>cd</strong> - change directory </p>\n<ul>\n<li>cd followed by a directory or file path will take you inside that directory(folder).</li>\n</ul>\n<p>  2. <strong>ls</strong> - list command</p>\n<ul>\n<li>Type <code>ls</code> and the contents of the current directory will be displayed.</li>\n</ul>\n<p>  3. <strong>man</strong> - manual command</p>\n<ul>\n<li>\n<p>Shows you the manual for the following command. This is very helpful when trying to figure out how an unfamiliar command works. For example, type <code>man ls</code> for everything you need to know about the ls command. Type <code>q</code> to exit.</p>\n</li>\n<li>\n<p><strong>pwd</strong> - path</p>\n</li>\n<li>\n<p>Type <code>pwd</code> to display the path to your current directory.</p>\n</li>\n<li>\n<p><strong>mkdir</strong> - make directory</p>\n</li>\n<li>\n<p>This command, followed by the name you wish to name your directory, creates a new directory. <code>mkdir folder1</code> will make a new directory called folder1.</p>\n</li>\n<li>\n<p><strong>rmdir</strong> - remove directory</p>\n</li>\n<li>\n<p>Removes the directory that follows the command. <code>rmdir folder1</code> will delete the directory named folder1 if it exists.</p>\n</li>\n<li>\n<p><strong>rm</strong> - remove</p>\n</li>\n<li>\n<p>This command removes files, not directories. <code>rm file.txt</code> will remove the file named file.txt as long as it exists and is in the current directory.</p>\n</li>\n</ul>",fields:{slug:"/linux/basic-linux-commands/"},frontmatter:{title:"Basic Linux Commands"}}},pathContext:{slug:"/linux/basic-linux-commands/"}}}});
